import {createRouter, createWebHistory} from "vue-router";
import Login from './pages/Login.vue'
import GestorServicos from './components/GestorServicos.vue'
import Servicos from './pages/Servicos.vue'
import Perfil from './pages/Perfil.vue'
import InfPessoais from "./components/InfPessoais.vue";
import InfServico from "./components/InfServico.vue";
import InfVeiculo from "./components/InfVeiculo.vue";
import InfCliente from "./components/InfCliente.vue";
import IndicarMotivo from "./components/IndicarMotivo.vue";

const router = createRouter({
    history: createWebHistory(),
    routes: [
        { path: '/', component: Login},
        { path: '/servico/:catchAll(.*)', component: GestorServicos},
        { path: '/servicos/:catchAll(.*)', component: Servicos},
        { path: '/perfil/:catchAll(.*)', component: Perfil},
        { path: '/:notFound(.*)', redirect: '/'},
        { path: '/infPessoais', component: InfPessoais},
        { path: '/infServico', component: InfServico},
        { path: '/infVeiculo', component: InfVeiculo},
        { path: '/infCliente', component: InfCliente},
        { path: '/indicarMotivo', component: IndicarMotivo},


    ]
});

export default router;
